import React from 'react';
import { motion } from 'framer-motion';
import { Check, Star, ArrowRight, TrendingUp, Target, Zap } from 'lucide-react';

const Pricing = () => {
  const services = [
    {
      name: 'Map PowerBoost',
      price: '$347',
      description: 'One-time Google Maps optimization boost to skyrocket your local rankings',
      features: [
        '300 Local Geotagged Map Points',
        '15-45 mile radius coverage',
        '20 driving direction paths',
        '10 Geotagged images',
        'NAP embedded stacking',
        '99 High DA backlinks',
        '30-Day Drip Feed',
        'Full Indexing Verification'
      ],
      cta: 'Get Started',
      popular: false,
      color: 'from-blue-500 to-blue-600'
    },
    {
      name: 'Google Authority Embeds',
      price: '$347',
      description: 'One-time authority building package to dominate your local market',
      features: [
        '800x iFrame Stacking Map Embeds',
        'Geotagged YouTube Video Embeds',
        'Web 2.0 Links from DA 20-30+ Sites',
        'High DA Do-Follow Backlinks',
        '30-Day Drip Feed',
        'Full Indexing Verification',
        'Google Sheet Backlink Report',
        'Priority Implementation'
      ],
      cta: 'Get Started',
      popular: true,
      color: 'from-orange-500 to-orange-600'
    }
  ];

  return (
    <section className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Header */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-primary-900 mb-6">
            Our Local SEO Services
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Choose the service that fits your needs. All services include our 30-day results guarantee.
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 max-w-6xl mx-auto mb-20">
          {services.map((service, index) => (
            <motion.div
              key={service.name}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -8, scale: 1.02 }}
              className={`relative bg-white rounded-2xl p-8 shadow-lg hover:shadow-2xl transition-all duration-300 ${
                service.popular ? 'ring-2 ring-orange-500 scale-105' : ''
              }`}
            >
              {/* Popular Badge */}
              {service.popular && (
                <div className="absolute -top-4 left-1/2 transform -translate-x-1/2">
                  <div className="bg-gradient-to-r from-orange-500 to-orange-600 text-white px-6 py-2 rounded-full text-sm font-semibold flex items-center gap-2">
                    <Star className="w-4 h-4" />
                    Most Popular
                  </div>
                </div>
              )}

              {/* Service Header */}
              <div className="text-center mb-8">
                <h3 className="text-2xl font-bold text-primary-900 mb-2">
                  {service.name}
                </h3>
                <div className="mb-4">
                  <span className="text-4xl font-bold text-primary-900">{service.price}</span>
                  <span className="text-gray-600"> one-time</span>
                </div>
                <p className="text-gray-600">{service.description}</p>
              </div>

              {/* Features */}
              <ul className="space-y-4 mb-8">
                {service.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-start gap-3">
                    <Check className="w-5 h-5 text-green-500 mt-0.5 flex-shrink-0" />
                    <span className="text-gray-700 text-sm">{feature}</span>
                  </li>
                ))}
              </ul>

              {/* CTA */}
              <div className="space-y-3">
                <button className={`w-full py-3 px-6 rounded-xl font-semibold transition-all duration-300 bg-gradient-to-r ${service.color} text-white hover:shadow-lg transform hover:scale-105`}>
                  {service.cta}
                </button>
                <a 
                  href={`/services/${service.name.toLowerCase().replace(/\s+/g, '-')}`}
                  className="w-full py-2 px-6 text-primary-600 hover:text-primary-700 font-medium text-sm text-center block"
                >
                  Learn More
                </a>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Service Comparison */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="max-w-4xl mx-auto mb-16"
        >
          <div className="bg-white rounded-2xl p-8 shadow-lg border border-gray-100">
            <h3 className="text-2xl font-bold text-primary-900 text-center mb-8">
              Which Service is Right for You?
            </h3>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
              <div className="text-center">
                <div className="w-12 h-12 bg-blue-100 rounded-full flex items-center justify-center mx-auto mb-4">
                  <TrendingUp className="w-6 h-6 text-blue-600" />
                </div>
                <h4 className="font-semibold text-blue-900 mb-2">Map PowerBoost</h4>
                <p className="text-gray-600 text-sm">
                  Perfect if you want to quickly boost your Google Maps rankings with targeted local optimization
                </p>
              </div>
              <div className="text-center">
                <div className="w-12 h-12 bg-orange-100 rounded-full flex items-center justify-center mx-auto mb-4">
                  <Zap className="w-6 h-6 text-orange-600" />
                </div>
                <h4 className="font-semibold text-orange-900 mb-2">Authority Embeds</h4>
                <p className="text-gray-600 text-sm">
                  Ideal for building long-term authority and dominating competitive local markets
                </p>
              </div>
            </div>
          </div>
        </motion.div>

        {/* Guarantee Section */}
        <motion.div 
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center"
        >
          <div className="bg-gradient-to-r from-primary-900 to-primary-800 rounded-3xl p-8 md:p-12 text-white max-w-4xl mx-auto">
            <h3 className="text-3xl font-bold mb-4">
              30-Day Results Guarantee
            </h3>
            <p className="text-xl text-gray-200 mb-8">
              If you don't see improvements in your local rankings within 30 days, we'll work extra hard or give you a full refund. No questions asked.
            </p>
            <button className="bg-orange-500 hover:bg-orange-600 text-white px-8 py-4 rounded-xl font-semibold text-lg transition-all duration-300 transform hover:scale-105 flex items-center gap-2 mx-auto">
              Start Your Free Strategy Call
              <ArrowRight className="w-5 h-5" />
            </button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Pricing;
